import React from "react";
import { HeaderFontPreview } from "./headerFont";
import { FontList } from "./fontList";

interface KhmerFontPreviewProps {
    previewText: string;
    fontSize: number;
    lineheight: number;
}

export const KhmerFont: React.FC<KhmerFontPreviewProps> = ({ previewText , fontSize, lineheight }) => {

    const khmertype = [
        "MyanmarAngoun",
        "MyanmarChatu",
        "MyanmarChatuLight",
        "MyanmarGantgaw",
        "MyanmarKhyay",
        "MyanmarKuttar",
        "MyanmarNayone",
        "MyanmarNjaun",
        "MyanmarPauklay",
        "MyanmarPhetsot",
        "MyanmarPhiksel",
        "MyanmarPhikselSmooth",
        "MyanmarPonenyet",
        "MyanmarSabae",
        "MyanmarSagar",
        "MyanmarSanpya",
        "MyanmarTagu",
        "MyanmarThuriya",
        "MyanmarWaso",
        "MyanmarYinmar"];

    return (
        <FontList title="Khmer Font Preview" previewText={previewText} fontSize={fontSize} data={khmertype} lineheight={lineheight} />
    );
};
